import React, { Component } from 'react';
import Form from './components/form';

class App extends Component {
  render() {
    state = {
      hello: 'hello'
    }
    return (
      <div>
        <h1>{this.state.hello}</h1>
        <Form />
      </div>
    );
  }
}

export default App;
